import { useState } from "react";
import { Container, Row, Col } from "react-bootstrap";
import projImg1 from "../assets/img/project-img1.png";
import projImg2 from "../assets/img/project-img2.png";
import projImg3 from "../assets/img/project-img3.png";
import colorSharp2 from "../assets/img/color-sharp2.png";
import 'animate.css';
import TrackVisibility from 'react-on-screen';

export const Projects = () => {
  const [activeFilter, setActiveFilter] = useState('all');

  const projects = [
    {
      title: "STAFFHUB",
      description: "HR Management System",
      imgUrl: projImg1,
      category: "fullstack",
      tech: ["Laravel", "PostgreSQL", "Tailwind CSS"],
      icon: "ðŸ‘¥"
    },
    {
      title: "Delivery Optimizer",
      description: "Logistics System",
      imgUrl: projImg2,
      category: "java",
      tech: ["Java Spring Boot", "REST API", "JUnit"],
      icon: "ðŸšš"
    },
    {
      title: "Full-Stack Application",
      description: "RESTful Web Service",
      imgUrl: projImg3,
      category: "fullstack",
      tech: ["React.js", "Node.js", "MongoDB"],
      icon: "âš™ï¸"
    },
    {
      title: "E-Commerce Platform",
      description: "Multi-vendor System",
      imgUrl: projImg1,
      category: "laravel",
      tech: ["Laravel", "MySQL", "Bootstrap"],
      icon: "ðŸ›’"
    },
    {
      title: "Mobile Web App",
      description: "React Native Project",
      imgUrl: projImg2,
      category: "fullstack",
      tech: ["React Native", "Firebase", "Expo"],
      icon: "ðŸ“±"
    },
    {
      title: "Portfolio Website",
      description: "Modern React Design",
      imgUrl: projImg3,
      category: "fullstack",
      tech: ["React", "CSS3", "JavaScript"],
      icon: "ðŸŽ¨"
    },
  ];

  const filteredProjects = activeFilter === 'all' ? projects : projects.filter(p => p.category === activeFilter);

  return (
    <section className="project" id="projects">
      <Container>
        <Row>
          <Col size={12}>
            <TrackVisibility>
              {({ isVisible }) =>
              <div className={isVisible ? "animate__animated animate__fadeIn": ""}>
                <div className="projects-header">
                  <h2>Featured Projects</h2>
                  <p>30+ professional projects delivered using modern technologies. Full-stack development specializing in web applications, REST APIs, and responsive designs. From enterprise solutions to innovative web platforms.</p>
                </div>
                
                <div className="projects-filter">
                  <button 
                    className={`filter-btn ${activeFilter === 'all' ? 'active' : ''}`}
                    onClick={() => setActiveFilter('all')}
                  >
                    All Projects
                  </button>
                  <button 
                    className={`filter-btn ${activeFilter === 'fullstack' ? 'active' : ''}`}
                    onClick={() => setActiveFilter('fullstack')}
                  >
                    Full Stack
                  </button>
                  <button 
                    className={`filter-btn ${activeFilter === 'laravel' ? 'active' : ''}`}
                    onClick={() => setActiveFilter('laravel')}
                  >
                    Laravel
                  </button>
                  <button 
                    className={`filter-btn ${activeFilter === 'java' ? 'active' : ''}`}
                    onClick={() => setActiveFilter('java')}
                  >
                    Java/Spring
                  </button>
                </div>

                <Row className="projects-grid">
                  {
                    filteredProjects.map((project, index) => {
                      return (
                        <Col size={12} sm={6} lg={4} key={index} className="project-col">
                          <div className="project-card">
                            <div className="project-card-image">
                              <img src={project.imgUrl} alt={project.title}/>
                              <div className="project-card-overlay">
                                <div className="project-icon">{project.icon}</div>
                              </div>
                            </div>
                            <div className="project-card-content">
                              <h4>{project.title}</h4>
                              <p className="project-description">{project.description}</p>
                              <div className="project-tech">
                                {project.tech.map((tech, idx) => (
                                  <span key={idx} className="tech-badge">{tech}</span>
                                ))}
                              </div>
                            </div>
                          </div>
                        </Col>
                      )
                    })
                  }
                </Row>
              </div>}
            </TrackVisibility>
          </Col>
        </Row>
      </Container>
      <img className="background-image-right" src={colorSharp2} alt="bg"/>
    </section>
  )
}
